function GetPlayerTargetTile()
{
	var targetTile = new v2();
	if(playerFacing == facingLeft)
	{
		var playerTileX = Math.floor(player.position.x / 4);
		targetTile.x = playerTileX - 1;
		targetTile.y = Math.round(player.position.y / 4);
	}
	else if(playerFacing == facingRight)
	{
		var playerTileX = Math.ceil(player.position.x / 4);
		targetTile.x = playerTileX + 1;
		targetTile.y = Math.round(player.position.y / 4);
	}
	else if(playerFacing == facingUp)
	{
		var playerTileY = Math.floor(player.position.y / 4);
		targetTile.y = playerTileY - 1;
		targetTile.x = Math.round(player.position.x / 4);
	}
	else if(playerFacing == facingDown)
	{
		var playerTileY = Math.ceil(player.position.y / 4);
		targetTile.y = playerTileY + 1;
		targetTile.x = Math.round(player.position.x / 4);
	}
	return targetTile;
}

function drawText(text, position, width)
{		
	var parts = text.split(" ");
	var currentPosition = new v2FromV2(position);
	var glyphCount = 0;
	for(var partIndex = 0;
		partIndex < parts.length;
		partIndex++)
	{
		var part = parts[partIndex];
		var partWidth = TextWidth(part);
		
		if(partWidth > width)
		{
			var first = "";
			var nextGlyphWidth = font.glyphWidths[GetGlyphIndex(part[first.length])];
			var currentWidth = 0;
			while(currentWidth + nextGlyphWidth < width)
			{
				first += part[first.length];
				currentWidth += nextGlyphWidth;
				nextGlyphWidth = font.glyphWidths[GetGlyphIndex(part[first.length])];
			}
			var second = part.substring(first.length);
			parts.splice(partIndex + 1, 0, second);
			part = first;
		}
		
		if(currentPosition.x + partWidth > width)
		{
			currentPosition.x = position.x;
			currentPosition.y += 7;
		}
		for(var textIndex = 0;
			textIndex < part.length;
			textIndex++)
		{
			var character = part[textIndex];
			var glyphIndex = GetGlyphIndex(character);
			var glyphX = font.glyphX[glyphIndex];
			var glyphWidth = font.glyphWidths[glyphIndex];
			var image;
			if(glyphCount % 2 == 0)
			{
				image = font.imageA;
			}
			else
			{
				image = font.imageB;
			}
			drawImage(image, glyphX, 0, glyphWidth, 6,
				currentPosition, true);
			glyphCount++;
			currentPosition.x += glyphWidth;
		}
		currentPosition.x += 1;
	}
}

function TextWidth(text)
{
	var result = 0;
	for(var textIndex = 0;
		textIndex < text.length;
		textIndex++)
	{
		var character = text[textIndex];
		if(character == " ")
		{
			result += 1;
		}
		else
		{
			var glyphIndex = GetGlyphIndex(character);
			var glyphWidth = font.glyphWidths[glyphIndex];
			result += glyphWidth;
		}
	}
	return result;
}

function GetGlyphIndex(character)
{
	var characterValue = ascii(character);
	var glyphIndex = 0;
	if(48 <= characterValue && characterValue < 58)
	{
		// Numbers
		glyphIndex = characterValue - 48; 
	}
	else if(97 <= characterValue && characterValue < 123)
	{
		// Lower case
		glyphIndex = characterValue - 97 + 10; 
	}
	else if(64 <= characterValue && characterValue < 90)
	{
		// Caps
		glyphIndex = characterValue - 65 + 10; 
	}
	else if(character == ".")
	{
		glyphIndex = 10 + 26;
	}
	else if(character == ",")
	{
		glyphIndex = 10 + 26 + 1;
	}
	else if(character == "!")
	{
		glyphIndex = 10 + 26 + 2;
	}
	else if(character == "-")
	{
		glyphIndex = 10 + 26 + 3;
	}
	else if(character == "?")
	{
		glyphIndex = 10 + 26 + 4;
	}
	else if(character == "'")
	{
		glyphIndex = 10 + 26 + 5;
	}
	return glyphIndex;
}

