function drawSpriteSheet(spriteSheet, position, percent, ignoreCameraOffset)
{
	if(percent > 1)
	{
		percent = 1;
	}

    var sourceX = 0;
    var sourceY = 0;
    var width = spriteSheet.image.width;
    var height = spriteSheet.image.height;
        
    //if(spriteSheet.type == "linearSpriteSheet")
	var numFrames = spriteSheet.image.width / spriteSheet.frameWidth;
	var frame = Math.floor(percent * (numFrames - 1));
	sourceX = spriteSheet.frameWidth * frame;
	width = spriteSheet.frameWidth;
	height = spriteSheet.frameHeight;
	
	drawImage(spriteSheet.image, sourceX, sourceY, width, height, position, ignoreCameraOffset);
}

function drawSprite(
    sprite, 
    position,
    ignoreCameraOffset // True when drawing UI elements.
    )
{   
	if(sprite.type == "animatedFrames")
	{
		var frame = Math.floor(sprite.animationSeconds * sprite.animatedFrameSprite.framesPerSecond);
		frame = frame % sprite.animatedFrameSprite.frames.length;
		sprite = sprite.animatedFrameSprite.frames[frame];
	}

    var sourceX = 0;
    var sourceY = 0;
    var width = sprite.image.width;
    var height = sprite.image.height;
        
    if(sprite.type == "animated")
    {
        var frame = Math.floor(sprite.animationSeconds * sprite.framesPerSecond);
        sourceX = sprite.frameWidth * frame;
        width = sprite.frameWidth;
        height = sprite.frameHeight;
    }
	
	drawImage(sprite.image, sourceX, sourceY, width, height, position, ignoreCameraOffset);
}

